const App = () => {
  const [timestamp, setTimestamp] = React.useState(Date.now())
  const { speed, items, spill, paused, scale, blurring, blurSeed } = useTweaks("Config", {
    speed: { value: 20, min: 5, max: 40, step: 1 },
    blurring: true,
    blurSeed: { value: 1, min: 0.1, max: 10, step: 0.1 },
    spill: false,
    scale: { value: 1, min: 0.1, max: 2, step: 0.1 },
    items: { value: 10, min: 1, max: 20, step: 1 },
    paused: false,
  })

  React.useEffect(() => {
    setTimestamp(Date.now())
  }, [items])

  // const renderStamp = Date.now()
  return (
    <div
      className="resizable"
      data-translate="items"
      data-direction="horizontal"
      data-blurring={blurring}
      data-play-state={paused ? 'paused' : 'running'}
      data-spill={spill}
      style={{
        '--speed': speed,
        '--count': items,
        '--scale': scale,
        '--blur': blurSeed,
      }}
    >
      <div className="container">
        <div className="blur blur--left">
          {new Array(8).fill().map((_, index) => (
            <div key={index} style={{ '--index': index }} />
          ))}
        </div>
        <ul>
          {new Array(items).fill(0).map((item, index) => {
            return (
              <li
                key={`index-${timestamp}--${index}`}
                style={{ '--index': index }}
                dangerouslySetInnerHTML={{ __html: ICONS[index % ICONS.length] }}
              />
            )
          })}
        </ul>
        <div className="blur blur--right">
          {new Array(8).fill().map((_, index) => (
            <div
              key={index}
              style={{
                '--index': index + 1,
              }}
            />
          ))}
        </div>
      </div>
    </div>
  )
}

render(<App />, ROOT_NODE)

